import styled from "styled-components";

function Upload() {
  const Button = styled.button`
    background: lightgray;
    padding: 1em;
    justify-content: center;
  `;

  return (
    <div>
      <h2>Drag your photos into the box below!</h2>
      <Button onClick={null}>Upload</Button>
    </div>
  );
}

export default Upload;
